tbreak} {:type :text, :text \"image, and map of home range for each one.\"}]}], :toc {:type :toc}}, :nextjournal/viewer :markdown} {:nextjournal/value \"(->> (query '[:select :distinct ?item ?itemLabel ?pic ?range\\n              :where [[?item (wdt :parent-taxon) * (entity \\\"Apodiformes\\\")\\n                       _ (wdt :taxon-rank) (entity \\\"species\\\")\\n                       _ rdfs:label ?englishName\\n                       _ (wdt :image) ?pic\\n                       _ (wdt :taxon-range-map-image) ?range]\\n                      :filter ((lang ?englishName) = \\\"en\\\")]\\n              :limit 10])\\n     (mapv #(vector :tr\\n                    [:td (:itemLabel %)]\\n                    [:td [:img {:src (wiki-image (:pic %))}]]\\n                    [:td [:img {:src (wiki-image (:range %))}]]))\\n     (into [:table])\\n     clerk/html)\", :nextjournal/viewer :code} {:nextjournal/viewer :clerk/result, :nextjournal/value {:nextjournal/edn \"{:path [], :nextjournal/value [:table [:tr [:td \\\"Pale-bellied Hermit\\\"] [:td [:img {:src \\\"https://commons.wikimedia.org/w/index.php?title=Special:Redirect/file/MonographTrochi1Goul%200236.jpg&width=300\\\"}]] [:td [:img {:src \\\"https://commons.wikimedia.org/w/index.php?title=Special:Redirect/file/Phaethornis%20anthophilus%20map.svg&width=300\\\"}]]] [:tr [:td \\\"Pale-bellied Hermit\\\"] [:td [:img {:src \\\"https://commons.wikimedia.org/w/index.php?title=Special:Redirect/file/Pale-bellied%20Hermit.jpg&width=300\\\"}]] [:td [:img {:src \\\"https://commons.wikimedia.org/w/index.php?title=Special:Redirect/file/Phaethornis%20anthophilus%20map.svg&width=300\\\"}]]] [:tr [:td \\\"White-whiskered Hermit\\\"] [:td [:img {:src \\\"https://commons.wikimedia.org/w/index.php?title=Special:Redirect/file/White-whiskered%20Hermit%20%28Phaethornis%20yaruqui%29.jpg&width=300\\\"}]] [:td [:img {:src \\\"https://commons.wikimedia.org/w/index.php?title=Special:Redirect/file/Phaethornis%20yaruqui%20map.svg&width=300\\\"}]]]
